INSERT INTO `faqs` (`id`, `category_id`, `category_name`, `author_id`, `author_name`, `author_location`, `title`, `body`, `created_at`, `updated_at`) VALUES
(5, 1, 'NAV/QLIKVIEW', 119, 'Keji	Ojelade', 'Lagos', 'How to Open Nav.', 'Click on your start button from your Desktop . Search with the keyword Nav 2015. \r\nYou will Navision Dynamics 2015 from the list . Click on the icon and enter Your Window login & Password', '2019-11-22 09:35:38', '2019-11-22 09:35:38'),
(6, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Account Lockout', 'To unlock your account, kindly call IT office requesting them to unlock your acccount', '2019-12-01 17:16:19', '2019-12-01 17:16:19'),
(7, 1, 'NAV/QLIKVIEW', 1, 'Gbenga Owoyele', 'Head Office', 'NAVISION SESSION ID ERROR', 'CLOSE THE APPLICATION AND RE-LAUNCH IT', '2019-12-12 08:15:21', '2019-12-12 08:15:21'),
(8, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Workstation Freeze', 'Press and hold down key combination \"Ctrl+Alt+Del\" to force the system to restart or press and hold down the power button till it goes off. Wait for two minutes and on the system.', '2019-12-14 22:15:25', '2019-12-14 22:15:25'),
(9, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Avaya Phone fails to come up', '1. Check the cable that runs from the wall jacket to the first port at the back of the Avaya for proper connection.\r\n2. If the option is ok and the phone is still off, disconnect and reconnect the two cables back. Otherwise, reach out to IT', '2019-12-14 22:24:31', '2019-12-14 22:24:31'),
(10, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Avaya Phone Shows login', 'Select the login, type your extension number for the login ID and \"1234\" as the password.', '2019-12-14 22:27:00', '2019-12-14 22:27:00'),
(11, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Managed Printer fails to list item(s) sent to the printer', '1. Check your workstation to be sure you are connected to the LAN.\r\n2. Confirm your window login id is not logged out by signing out from workstation and sign in\r\n3. Reboot your workstation, resend the item again.\r\n4. Contact IT if the problem persists.', '2019-12-14 22:38:05', '2019-12-14 22:39:08'),
(12, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'The Managed Printer fails to accept my credentials', 'Contact the IT team to unlock your account.', '2019-12-14 22:40:42', '2019-12-14 22:40:42'),
(13, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'WI-FI Icon show amber colour', '1. Disconnect the wifi and reconnect it back\r\n2. Contact the IT team if the status quo remains.', '2019-12-14 22:42:52', '2019-12-14 22:42:52'),
(14, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Workstation is extremely slow', '1. Reboot the workstation\r\n2. Contact the IT team if the status quo remains.', '2019-12-14 22:45:16', '2019-12-14 22:45:16'),
(15, 2, 'Computers, Networks & Others', 42, 'Waheed	Mudashiru', 'Head Office', 'Workstation shows IP conflict', 'Please contact IT for a swift solution.', '2019-12-14 22:47:37', '2019-12-14 22:47:37'),
(16, 1, 'NAV/QLIKVIEW', 42, 'Waheed	Mudashiru', 'Head Office', 'Unable to post on Nav', 'Please contact the IT team to free up the system process.', '2019-12-14 22:49:53', '2019-12-14 22:49:53'),
(17, 2, 'Computers, Networks & Others', 2, 'Olanrewaju Odunlami', 'Kaduna', 'RFID printing VOID tags', 'Reset the ribbon and tags on the printer', '2019-12-16 07:47:37', '2019-12-16 07:47:37'),
(18, 1, 'NAV/QLIKVIEW', 2, 'Olanrewaju Odunlami', 'Kaduna', 'RFID - Unable to post to NAV', 'Check network cable connection to the touchscreen. Confirm status of NAV server. Reload another truck and post.', '2019-12-16 07:50:28', '2019-12-16 07:50:28'),
(19, 2, 'Computers, Networks & Others', 2, 'Olanrewaju Odunlami', 'Kaduna', 'RFID - Unable to scan mattresses', 'Restart the RFID app. Reconnect the scanner and re-scan.', '2019-12-16 07:53:46', '2019-12-16 07:53:46'),
(20, 2, 'Computers, Networks & Others', 1, 'Gbenga Owoyele', 'Head Office', 'Frequent Account Locked out', 'This happens when you use your account on a mobile device with a wrong or old password. To resolve this go to Wifi on your mobile device, click on Mouka-secure, click forget. Then Call IT support to unlock.', '2019-12-17 07:51:47', '2019-12-17 07:51:47'),
(22, 2, 'Computers, Networks & Others', 3, 'Shamsideen Odu', 'Benin', 'WANT TO RAISE A TICKET AND ACCOUNT IS LOCKED', 'ANOTHER USER CAN RAISE A TICKET ON YOUR BEHALF OR YOU RAISE IT FROM ANOTHER SYSTEM.', '2019-12-19 10:05:56', '2019-12-19 10:05:56'),
(23, 2, 'Computers, Networks & Others', 1, 'Gbenga Owoyele', 'Head Office', 'CHANGE PASSWORD', 'PRESS CTRL +ALT+DEL, then click change a password. The password dialog box shows. Input present password in the space of old password. Input new password twice. Use standard password policy.', '2020-01-08 08:03:30', '2020-01-08 08:03:30'),
(24, 2, 'Computers, Networks & Others', 1, 'Gbenga Owoyele', 'Head Office', 'SCAN BUT NOT SAVING', 'THIS HAPPENS WHEN LEXMARK ACCOUNT IS LOCKED OUT. CALL IT ADMIN TO UNLOCK LEXMARK ACCOUNT', '2020-03-09 12:26:21', '2020-03-09 12:26:21');
